import React, { Component } from 'react';
import Team from './Team';
import PropTypes from 'prop-types';

class Teams extends Component {
    render() {
        return this.props.teams.map((team) => (
            <h3>{ team.name }</h3>,
            <p>{ team.platform }</p>
        ))
    }
}

//PropTypes
Teams.propTypes = {
    teams: PropTypes.array.isRequired
}

export default Teams;
